import React, { useEffect } from "react";

export default function GetallIP(ac) {
  const APIbody = {
    "X-Cisco-Meraki-API-Key": `${ac.dc.apiKey}`,
    organizationId: `${ac.dc.organizationID}`,
    networkId: `${ac.dc.networkID}`,
  };

  useEffect(() => {
    fetch("/clients", {
      method: ["POST"],
      cache: "no-cache",
      headers: {
        content_type: "application/json",
      },
      body: JSON.stringify(APIbody),
    }).then((response) => {
      return response.json;
    });
    fetch("/devices")
      .then((res) => res.json())
      .then((client) => {
        ac.dc.setclientList(client.devices);
      });
  }, [ac.dc.networkID]);

  const test = () => {
    ac.dc.clientList.map((item) => {
      console.log(item);
    });
  };

  return (
    <div>
      <button onClick={test}>BUTTON</button>
    </div>
  );
}
